import React, { useEffect, useRef } from "react";
import styles from "../style/Bieudo.module.scss";

function Bieudo() {
  const container = useRef();

  useEffect(() => {
    // TradingView Widget script
    const script = document.createElement("script");
    script.src = "https://s3.tradingview.com/tv.js";
    script.async = true;
    script.onload = () => {
      if (window.TradingView) {
        new window.TradingView.widget({
          container_id: "tradingview-chart",
          autosize: true,
          symbol: "VN30F1M", // giống trong ảnh
          interval: "5",
          timezone: "Asia/Ho_Chi_Minh",
          theme: "dark",
          style: "1",
          locale: "vi_VN",
          enable_publishing: false,
          allow_symbol_change: true,
          studies: ["Volume@tv-basicstudies"],
        });
      }
    };
    container.current.appendChild(script);
  }, []);

  return (
    <div className={styles.bieudoWrapper}>
      {/* Cột trái: Chart */}
      <div className={styles.chartArea}>
        <div id="tradingview-chart" className={styles.tradingView}></div>
      </div>

      {/* Cột phải: Bảng thông tin */}
      <div className={styles.assetPanel}>
        <div className={styles.tabs}>
          <button className={styles.activeTab}>Tài sản</button>
          <button>10 Giá</button>
          <button>Lịch sử giao dịch</button>
          <button>Mã phái sinh</button>
        </div>

        <div className={styles.assetInfo}>
          <div><span>Tổng lợi nhuận</span> <span>10,046.59</span></div>
          <div><span>Mã hợp đồng</span> <span>VN30F2501</span></div>
          <div><span>Vị thế</span> <span>--</span></div>
          <div><span>Lãi lỗ</span> <span className={styles.green}>2,046.59</span></div>
          <div><span>Sức mua (357007)</span> <span>--</span></div>
          <div><span>Lãi/lỗ chưa đóng</span> <span>--</span></div>
          <div><span>Tổng tài sản</span> <span>120,000,0000</span></div>
          <div><span>Tiền mặt</span> <span>--</span></div>
          <div><span>Tiền ký quỹ tại VSD</span> <span>--</span></div>
          <div><span>Ký quỹ ban đầu</span> <span>--</span></div>
          <div><span>Phí giao dịch + thuế</span> <span>--</span></div>
          <div><span>Tỷ lệ sử dụng TSKQ</span> <span>100%</span></div>
          <div><span>Tỷ lệ an toàn</span> <span>100%</span></div>
          <div><span>Phí trả VSD</span> <span>500.00</span></div>
        </div>
      </div>
    </div>
  );
}

export default Bieudo;
